import Main from "./Components/Main"
import Footer from "./Components/Footer"
import { BrowserRouter, Route, Routes } from "react-router-dom";


function App() {
  return (
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Main />} />
          <Route path="/main" element={<Footer />} />
        </Routes>
      </BrowserRouter>
  );
}

export default App;
